import React from "react";
import { Box } from '@material-ui/core';

function SortByWeek() {
    return (
        <Box
            sx={{
            backgroundColor: '#ffffff',
            color: '#929292',
            textAlign: 'start',
            width: '150px'
        }}
        >
            Sort by week
        </Box>
    )
}

export default SortByWeek;
